function App() {
  return (
    <div className="App">
      <div className='header'>
      <h2>Hi, I'm Summer Bakr.</h2>
      <h3>I'm a </h3>
    <Typical
        steps={['budding software developer', 1000, 'avid learner', 1000, "dedicated and passionate individual", 1000]}
        loop={Infinity}
        wrapper="p"
      />
    </div>
    <Router />

    </div>
  );
}

export default App;
